import React from 'react'
import { Link } from 'react-router-dom'
import axios from 'axios';
import './index.css';

export default function Navbar() {
  const user = localStorage.getItem('user')
  console.log(user, 'id')

  const logoutHandler = async () => {
    localStorage.removeItem("name");
    const responce = await axios.get('/logout', { withCredentials: true })
    console.log("24", responce)
    if (responce.status === 200) {
      window.location.href = "/"
    }
  };


  return (
    <div className='navbar'>
      <ul className='navbar__list'>
      <li className='list__item'>
          <Link to="/"  style={{ textDecoration: 'none', color: '#03436A' }}>Main</Link>
        </li>
        {user ? (
          <li className='list__item'>
          <Link to="logout" style={{ textDecoration: 'none', color: '#03436A' }}>Log out</Link>
        </li>
        ) :(
        <li className='list__item'>
          <Link to="signup" style={{ textDecoration: 'none', color: '#03436A' }}>Sign up</Link>
        </li>
        )}
        </ul>
    </div>
  )
}
